able ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"241786","type":"CustomJS"},{"attributes":{"coordinates":null,"group":null},"id":"241847","type":"Title"},{"attributes":{"overlay":{"id":"241754"}},"id":"241749","type":"BoxZoomTool"},{"attributes":{},"id":"241558","type":"UnionRenderers"},{"attributes":{},"id":"241598","type":"BasicTicker"},{"attributes":{"dimensions":"width"},"id":"241747","type":"PanTool"},{"attributes":{"dimensions":"width","maintain_focus":false},"id":"241606","type":"WheelZoomTool"},{"attributes":{},"id":"241775","type":"BasicTickFormatter"},{"attributes":{},"id":"241753","type":"SaveTool"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwP3A0JpG0DPA/8wPR9hNF8D/l2QYh6TrwPzNrwmGdDvA/LK30hZEA8D9LKX43lYjvP1hIYC2npu8/uXons7nC7z/nUjBnVQPwP8aqA8d+CvA/GxszoM3H7z8ZM7XWI57vP17RcVDiRe8/dsnBXLLZ7j8qfB5gRJvuP5Dh3I3juu4/Vv9Zhkeh7j+oHBGOhMbsP4Mk8N2f2Ow/1xyI6dmM7T/mJoYsXzPtPxfs1Pz7M+0/bGNydUdA7T+7hDIfHHTtP3OLdzkJQu0/+YPZn6Mw7T8gPBAHOJXtP2NPHct9wu0/aN64Fvuc7T/V3okLV6btPyvJ4xshYu0/TRbu9+wi7T/xSdwW7SntP4Mv7cbEd+0/34YNz8HV7D9z8uRBk1DsPzMRgDeZY+w/p6umH6DY6z+r23Sa+ZTrPzGeT0kHx+s/YhYJBZ/R6z9dfys83JzsP5kNgFg5++w/4vbooX/I7D/EL9kMOTztP7CFIL4FJu0/sN2slDE07j/7592E9entPyft+0g2VO0/9j177oDb7D8glrHsBA7tPwuVPlukDO0/KK9ErgBA7T9VVlacJxztPzo/OhK76Ow/9ZPkZuTW7D/tvXn/1RLtP6MpKIgj/+w/Kbb6tW/R7D85lxcw5sbsP19JtGcF1Ow/LF9X6zrv7D8Ig4FmXt7sPy658YTk6Ow/TiLz+cYW7D/aawpG10zsP8k26TtZOOw/e6
